import os
import sys
import platform
from typing import List, Tuple
from ctypes import cdll, create_string_buffer, POINTER, byref
from ctypes import c_uint, c_int, c_char, c_char_p, c_float, c_longlong

from ctypes import create_string_buffer, Array, POINTER, c_int, c_char, byref
from typing import List
from os.path import join
from lzma import decompress
from base64 import b85decode

__error = None

def create_cb(size) -> Array:
    return create_string_buffer(b'\000' * size)


def cb_to_string(cb: Array) -> str:
    return bytearray(cb).decode('utf-8').strip('\000')


def cb_to_list(cb: Array) -> List[str]:
    return [ s for s in cb_to_string(cb).split('\000') if len(s) > 0 ]


def to_bytes(s: str) -> bytes:
    return s.encode('utf-8')


def _check_error(result: int, func, args):
    """
    Called after every function.
    """
    if (result != 0):
        # This is an error.
        # Retrieve error string.
        errb = create_cb(16384)
        kind = c_int()
        __error(result, errb, 16384, byref(c_int))
        error = cb_to_string(errb)

        if kind == 1: raise IndexError(error) # out_of_range
        if kind == 2: raise TypeError(error) # invalid_argument
        if kind == 3: raise RuntimeError(error) # logic_error
        if kind == 4: raise RuntimeError(error) # runtime_error
        if kind == 5: raise MemoryError(error) # bad_alloc
        
        raise Exception(error) # all others


def _load_library(bufferOrFile: str, rel_path: str, fn: str):
    """
    If str, assume it's a path to the dll/so/dylib, otherwise write buffer to 
    temp file and load it from there.
    """
    from ctypes import cdll

    if not bufferOrFile:
        raise RuntimeError('No binary implementation on this platform')

    if len(bufferOrFile) < 1024: # just a filename?
        return cdll.LoadLibrary(bufferOrFile)
    else:
        bufferOrFile = ''.join([ l for l in bufferOrFile.split('\n') if len(l) > 0 ])
        bufferOrFile = decompress(b85decode(bufferOrFile))

        from platform import system
        from os.path import expanduser, join
        from os import makedirs

        # extract to home/rel_path/fn[.ext]
        path = expanduser(f'~/{rel_path}')
        makedirs(path, exist_ok=True)
        ext = { 'Windows': '.dll', 'Linux': '.so', 'Darwin': '.dylib' }[system()]
        dll = join(path, fn + ext)
        with open(dll, 'wb') as f:
            f.write(bufferOrFile)
        return cdll.LoadLibrary(dll)


def load_library(windows: str, linux_intel: str, linux_arm: str, darwin: str, rel_path: str, fn: str):
    """
    Load the instance that matches the OS. 64 bit is assumed.
    """
    from sys import maxsize, version_info

    if (maxsize <= 2**32):
        raise Exception('Only 64 bit runtime is supported.')
    if version_info[0] < 3:
        raise Exception('At least Python 3 is required.')

    from platform import system

    osname = system()
    if osname == 'Linux':
        from os import uname
        osname += 'ARM' if uname()[4].startswith('aarch') else 'Intel'

    lib = _load_library({
            'Windows': windows,
            'LinuxIntel': linux_intel,
            'LinuxARM': linux_arm,
            'Darwin': darwin
        }[osname],
        rel_path,
        fn
    )

    global __error
    __error = lib.__wrapper_error
    __error.argtypes = [c_int, POINTER(c_char), c_int, POINTER(c_int)]
    __error.restype = None

    return lib


def build_function(call, args, result):
    """
    Create a function call to the dll/so/dylib.
    """
    call.argtypes = args
    call.restype = result
    call.errcheck = _check_error
    return call

