def _getPeripheralName(handle: int, interfaceId: int) -> str:
    r = create_cb(_MaxIdentLength)
    _GetPeripheralName(handle, interfaceId, r, _MaxIdentLength)
    return cb_to_string(r)

class _DeviceType:
    """
    Values to be used in enumeration.
    """

    def __init__(self, interfaceId: int, name: str):
        self._interfaceId = interfaceId
        self.__name = name

    @staticmethod
    def _getDeviceTypeById(cid: int):
        return {
            _CeboMsrTypeAll: DeviceType.All,
            _CeboMsrTypeUsb: DeviceType.Usb,
            _CeboMsrTypeCeboLC: DeviceType.CeboLC,
            _CeboMsrTypeCeboStick: DeviceType.CeboStick,
        }[cid]

    def getName(self) -> str:
        """
        Return instance name as string, "Usb", "All", ...
        """
        return self.__name

